import { Form, Input } from "antd";
import React from "react";

const NicknameEditFrom = () => {
  const style = useMemo(() => ({
    marginButton: "20px",
    border: "1px,solid,#d9d9d9",
    padding: "20px",
  }));
  return (
    <Form style={style}>
      <Input.Search addonBefore="닉네임" enterButton="수정" />
    </Form>
  );
};
export default NicknameEditFrom;
